// frontend/src/components/InteractionHistory.jsx
import React from 'react';
import './InteractionHistory.css';

const InteractionHistory = ({ history, historyHeight, onClear }) => {
  return (
    <div className="interaction-record card">
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <h2 className="card__title">‰∫§‰∫íËÆ∞ÂΩï</h2>
        <button onClick={onClear} className="clear-btn">Ê∏ÖÈô§ËÆ∞ÂΩï</button>
      </div>
      <div className="history-scroll" style={{ height: `${historyHeight}px` }}>
        {history.length === 0 ? (
          <p className="muted">ÊöÇÊó†ËÆ∞ÂΩïÔºåÂèëÈÄÅ‰ªª‰∏ÄÊ®°ÂùóÂêéÂ∞ÜÂú®Ê≠§ÊòæÁ§∫„ÄÇ</p>
        ) : (
          <ul className="history">
            {history.map((h) => (
              <li key={h.id}>
                <div className="history__line">
                  {h.traffic_condition && (
                    <span className="pill">{h.traffic_condition}</span>
                  )}
                  {h.incident_detected && (
                    <span className="tag">incident</span>
                  )}
                  <span className="loc">{h.location || h.area || "-"}</span>
                </div>
                <div className="history__meta">
                  <span>{h.at}</span>
                  {typeof h.vehicle_speed !== "undefined" && (
                    <span>{h.vehicle_speed} km/h</span>
                  )}
                  {typeof h.available_spots !== "undefined" && (
                    <span>{h.available_spots} spots</span>
                  )}
                  {h.alert_type && <span>‚ö† {h.alert_type}</span>}
                  {h.safety_status && <span>üõ° {h.safety_status}</span>}
                  <span className={h.message === "received" ? "ok" : ""}>
                    {h.message}
                  </span>
                </div>
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default InteractionHistory;
